ntil it ends near Armstrong Street.

It's mainly a grassed area with a number of native trees but other than the public toilets at the Cowderoy Street end, there are no public facilities such as BBQs, picnic tables or bench seats (hint, hint to City of Port Phillip).  It's often used by kitesurfers preparing to setup at the start of their windsurfing day, or at the end of the day when they are packing up their gear to head off home.  It is also sometimes used for dog walking and on hot days you will often see people just laying on the shaded grassed areas under the canopy of trees on the reserve.

Another plus for Cummings Reserve is that it provides a green open space for the apartments and dwellings along that section of Beaconsfield Parade, giving residents a green area to overlook over.", "time": 1671018537, "rating": 3, "language": "en", "author_url": "https://www.google.com/maps/contrib/115161916543124945682/reviews", "translated": false, "author_name": "Adam G", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjWHKbGKA4yk0lGwUh5SisrD6ZNrdrz2sQFWS61cWZt0H8JZKNvrGA=s128-c0x00000000-cc-rp-mo-ba8", "relative_time_description": "a year ago"}, {"text": "Grew up round, brings back many memories and one my favourite places to take the camera.", "time": 1701944448, "rating": 4, "language": "en", "author_url": "https://www.google.com/maps/contrib/100108687734038854629/reviews", "translated": false, "author_name": "Boyd Wilson", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocIPIEKJ_aKTGWNHaSixFV89kbU6Oq5JWel-VOSpvjzJxYpVkQ=s128-c0x00000000-cc-rp-mo-ba3", "relative_time_description": "9 months ago"}, {"text": "Nothing can be better visit this place at the sun set. This place can be very windy, you may take warm clothes and wear glass while you are walking on the dam.", "time": 1641434709, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/111241611405372890745/reviews", "translated": false, "author_name": "Abra Alam Chowdhury", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjWlMOlisc04bQtfbih8wqDo5vcn6izl0oWjlqmFJ6rqKqaWcw4=s128-c0x00000000-cc-rp-mo-ba3", "relative_time_description": "2 years ago"}, {"text": "Great spot for a SWS wind. Great swell and easy to ride.", "time": 1697524132, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/116074419304031305020/reviews", "translated": false, "author_name": "Gerhard J Mayer", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXGrUTkvc-e21t5tfxv5XhKtjKABsTemPX14hxxWMLnraOyQbDtRA=s128-c0x00000000-cc-rp-mo-ba5", "relative_time_description": "10 months ago"}, {"text": "It's the incredible beach that is the main feature here. Fine white sand in a huge arc that would be very desirable in Europe. There is a small concrete pier for sea access, which isn't common. Not much cover here so bring a beach umbrella etc. Can be windy, so be prepared. Joggers everywhere. Lovely place for fresh air and contemplation. People walk dogs here. My five year old only goes there for the dog licks.", "time": 1674940591, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/108682739230489761191/reviews", "translated": false, "author_name": "angie robinson", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocJZq8gJJLZOqar2fUko-CWvITRgcOIEHc1LBLpE8bmla4C_ug=s128-c0x00000000-cc-rp-mo-ba3", "relative_time_description": "a year ago"}], "geometry": {"location": {"lat": -37.8564236, "lng": 144.9659462}, "viewport": {"northeast": {"lat": -37.8550062697085, "lng": 144.9673503302915}, "southwest": {"lat": -37.8577042302915, "lng": 144.9646523697085}}}, "place_id": "ChIJf4fPKjdp1moRueqluvM6rlY", "vicinity": "Cummings Reserve, 299-312 Beaconsfield Parade, Saint Kilda West", "plus_code": {"global_code": "4RJ64XV8+C9", "compound_code": "4XV8+C9 Saint Kilda West VIC, Australia"}, "reference": "ChIJf4fPKjdp1moRueqluvM6rlY", "utc_offset": 600, "adr_address": "Cummings Reserve, <span class="street-address">299-312 Beaconsfield Parade</span>, <span class="locality">St Kilda West</span> <span class="region">VIC</span> <span class="postal-code">3182</span>, <span class="country-name">Australia</span>", "business_status": "OPERATIONAL", "formatted_address": "Cummings Reserve, 299-312 Beaconsfield Parade, St Kilda West VIC 3182, Australia", "address_components": [{"types": ["premise"], "long_name": "Cummings Reserve", "short_name":