inking it next to the beach.  Opening times can be erratic.

Be happy this place exists!", "time": 1718703964, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/100687678368466802849/reviews", "translated": false, "author_name": "KC kaleuclint", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocJ0j2DqMJwPgfCGc0ulORKZbhE4mEUtUuV-Tjt0iyyeA1Lo8Q=s128-c0x00000000-cc-rp-mo", "relative_time_description": "2 months ago"}, {"text": "Perfect little kiosk on Port Melbourne beach.  Surrounded by gorgeous flower filled planters.   Theresa and Angela know all the regulars by name and look out for them.    Lovely freshly made food on the premises.     Their muffins are to die for - different flavour freshly baked every day but you have to get in early.    Fish and chips are excellent too - we regularly swim and then finish up with those.", "time": 1714798787, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/104635731678989312772/reviews", "translated": false, "author_name": "Kathy Chapman", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjXZnnM_V3IQP3HdRz0Kq6p3EQaxHmuRCuHQVZZEHNmdOW-nlTMi=s128-c0x00000000-cc-rp-mo", "relative_time_description": "4 months ago"}, {"text": "Simply the best muffins I've ever tasted. Baked fresh every day with real butter and love. Teresa, Angela and crew will make you feel like family in no time. Fish n Chips are really awesome too.", "time": 1714798468, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/114099949878022307028/reviews", "translated": false, "author_name": "Peter Waters", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjVMb0mFD6OZQJwNByOwJ1NWh0it8sZJ5flMitZ7vt0__D7rOu00=s128-c0x00000000-cc-rp-mo", "relative_time_description": "4 months ago"}, {"text": "Unfriendly owner and horrible coffee

