h and tasty.", "time": 1719115961, "rating": 4, "language": "en", "author_url": "https://www.google.com/maps/contrib/115597383838211365533/reviews", "translated": false, "author_name": "Matt", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocKuPgV56U6iyHIraGme8426SpX7xRIb-JVukYe2KVL10qrdQQ=s128-c0x00000000-cc-rp-mo-ba5", "relative_time_description": "a month ago"}, {"text": "We had a wonderful early breakfast experience and despite the freezing 6 degree morning.

