 facilities are good. Nice full fenced environment to let your four legs friends off leash to explored.", "time": 1673131421, "rating": 4, "language": "en", "author_url": "https://www.google.com/maps/contrib/111609306495397208663/reviews", "translated": false, "author_name": "Mandy Zhang", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjU8sGbKKr_KuuS2Q5xYmgCp4qkqvkI8Ljxk4IouCxq6qJDfUdkw=s128-c0x00000000-cc-rp-mo", "relative_time_description": "a year ago"}, {"text": "Great new dog park, has a lot more space than most other dog parks including the time out zone. Everything was clean and it had some obstacles for the dogs to use, most of which were natural (logs, rocks). I highly recommend it to other dog owners!", "time": 1658986295, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/115991947385995805484/reviews", "translated": false, "author_name": "Emily Harrison", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocLQvzY8ptbAUO4Jj16im3xQ5V7M5ftbisDJI4S-0ncTMRHP=s128-c0x00000000-cc-rp-mo-ba2", "relative_time_description": "2 years ago"}, {"text": "Absolutely beautiful dog park, separated into two areas - one for all dogs and the other for small dogs, puppies, or any dogs who want some quiet time for themselves. It is well taken care of, mostly mulched but has some grass patches too.", "time": 1674485074, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/101444503479284248610/reviews", "translated": false, "author_name": "Bilian Loi", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUg0eUOVgNPWNbMjZCIKbX9NXBe9qqWt0jbqaZsTiOM00QsO42ISg=s128-c0x00000000-cc-rp-mo-ba4", "relative_time_description": "a year ago"}, {"text": "Great dog park. Some favourites include: benches, sand pit, drinking fountains, large in size, has a seperate enclosure for smaller dogs, tunnels, climbing mountains. The people here also seem friendly and everyone appreciates the opening of this park up - especially my dog!
Some things that could be improved: lights (it gets dark so early in winter so you wouldn‚Äôt be able to hang there when it is dark), a latch on the gates - today the gate opened from the wind and a dog ran out (luckily there are double gates for every entry so it couldn‚Äôt fully escape), an extra rubbish bin on the other side of the park, dog poop bags could be provided like some other dog parks and perhaps some more parking.

Overall, really good dog park. Will come back for sure!", "time": 1657952772, "rating": 4, "language": "en", "author_url": "https://www.google.com/maps/contrib/105986603382204702918/reviews", "translated": false, "author_name": "Makaronchik", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUsP9RTvlWRnVSh-aMdRzGsjFNGc0piD3n4Gl-YdHb6N2Cvknn-=s128-c0x00000000-cc-rp-mo", "relative_time_description": "2 years ago"}, {"text": "Our go to local dog park. Generally dogs there are sociable and their owners are friendly. Our dog hasn't had any issues with other aggressive dogs there. Most people pick up their dogs poo.", "time": 1700371529, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/104966423027275781292/reviews", "translated": false, "author_name": "Hilda Yan", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUuYBx5BzcQA8ncrsR7L-c1SDs2WyWbbpxXWjf9BRo0YA89ilt5og=s128-c0x00000000-cc-rp-mo-ba4", "relative_time_description": "9 months ago"}], "website": "https://www.maroondah.vic.gov.au/Explore/Parks-and-playgrounds/Parks-and-Facilities/Parkwood-Dog-Park", "geometry": {"location": {"lat": -37.78345840000001, "lng": 145.2424761}, "viewport": {"northeast": {"lat": -37.78202151970851, "lng": 145.2438468302915}, "southwest": {"lat": -37.7847194802915, "lng": 145.2411488697085}}}, "place_id": "ChIJg4BNwIM71moREt2z6W_sSxE", "vicinity": "35-39 Tortice Drive, Ringwood North", "plus_code": {"global_code": "4RJ7668R+JX", "compound_code": "668R+JX Ringwood North VIC, Australia"}, "reference": "ChIJg4BNwIM71moREt2z6W_sSxE", "utc_offset": 600, "adr_address": "<span class="street-address">35-39 Tortice Dr</span>, <span class="locality">Ringwood North</span> <span class="region">VIC</span> <span class="postal-code">3134</span>, <span class="country-name">Australia</span>", "business_status": "OPERATIONAL", "formatted_address": "35-39 Tortice Dr, Ringwood North VIC 3134, 