ark on the map) and has oodles of potential. More than that, there are plans to continue upgrading the parkland, which is terrific. At the front is the lovingly restored Strathdon House, now being used as a neighbourhood/community house. It is possible to walk front to back if you don't mind some cat-tracks or no tracks in a couple of spots. I'll admit it felt like the Tardis to me... it looks small from the front, but it is bigger on the inside.", "time": 1657807279, "rating": 4, "language": "en", "author_url": "https://www.google.com/maps/contrib/117206115896041180836/reviews", "translated": false, "author_name": "Anita Harris", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUkQHmgEhZZCkl2J787sbUdvfUT1w00WzTSULnqTLWGrVnsAw8=s128-c0x00000000-cc-rp-mo-ba7", "relative_time_description": "2 years ago"}, {"text": "Awesome dog park, bordered mostly by back fences, so dogs can enjoy the space without the danger of roads. The path connecting through it is pretty useful for cyclists, but the gravel is a bit too loose for safe riding.", "time": 1579311958, "rating": 4, "language": "en", "author_url": "https://www.google.com/maps/contrib/112729654761670400820/reviews", "translated": false, "author_name": "Pauline Laing", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjUbGaZFURP_NrtP2-hvGgG2ftKJwvAHFGLtZpi-OqtyYiHjYJ4EyQ=s128-c0x00000000-cc-rp-mo-ba6", "relative_time_description": "4 years ago"}, {"text": "Spacious and wide with a great view of the mountains.

