ic toilet, drinking fountains for people and pooches, a barbecue, several picnic tables, and a dog playground area. There is lots of grass and shade under the pine trees. It‚Äôs close to Jells Park and you get some nice views towards Glen Waverley and Mulgrave.

A few slight cons: the facilities are a bit tired, (but nothing appears to be broken); no undercover area (so no shelter from rain); no rubbish bins - signs clearly ask you to take your rubbish home. Unfortunately lots of people seem to think this does not apply to them. Make sure you take your doggy-doo/rubbish bags in and out! And BYO coffee etc - there is no cafe within walking distance.

NB This park caters for people with fur-babies, not so much for human ones. Older kids who are confident and well-behaved around dogs will be fine. Just keep in mind that there is no children‚Äôs play equipment and there are always dogs of all sizes off-leash here.", "time": 1714271388, "rating": 4, "language": "en", "author_url": "https://www.google.com/maps/contrib/110980006536598737569/reviews", "translated": false, "author_name": "Silvia Ercole", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a/ACg8ocLqb_zOPFU4NvZe_tdlQsPV_UtahrDQ9WWJXScS29OhA_KaNA=s128-c0x00000000-cc-rp-mo-ba3", "relative_time_description": "4 months ago"}, {"text": "Great place for people exercising their dogs, fantastic views of the City on the horizon, plenty of walk ways in the bush and along the rivers, park your car here, take a stroll to Jells Park, around the lake and back, all in just 7.7 km.", "time": 1716200014, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/109762837598210230822/reviews", "translated": false, "author_name": "Jacob Cybulski", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjWCA7LWVHpv01WLoaCQXOO3If58bCsPtmnxeV7AIRPb9uHGMrcg5A=s128-c0x00000000-cc-rp-mo-ba3", "relative_time_description": "3 months ago"}, {"text": "Good place for off leash time with your dog. Well fenced/ secure, plenty of parking. And the park is big enough to have some space and play ball with the dog. Other dogs are generally quite well behaved. There is also a basic dog agility course, and a sand pit for the dogs. Water is available, from a tap.", "time": 1717829813, "rating": 4, "language": "en", "author_url": "https://www.google.com/maps/contrib/108042848930931179863/reviews", "translated": false, "author_name": "Paul Hendrick", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjWipS-vjafiDbk6U5cwtUbO_evKsdXiGJlH6DHy-lQOVQXeMFSQ=s128-c0x00000000-cc-rp-mo-ba5", "relative_time_description": "3 months ago"}, {"text": "It is very short loop, nice place to hang around with the kids and family in the playground having a nice picnic. Best time is any time of the year to visit and hang around.", "time": 1715149677, "rating": 5, "language": "en", "author_url": "https://www.google.com/maps/contrib/105066031632989074351/reviews", "translated": false, "author_name": "Sudha Karthik", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjU3MqX45_TejALH1RN9pqIrTpDtdza-ac2S7gDvsCz2wwMqB52qqQ=s128-c0x00000000-cc-rp-mo-ba4", "relative_time_description": "4 months ago"}, {"text": "Lovely big park. Off lead, dog friendly.  Lots of shade, doggy play ground. Beware though- if your dog likes water, there's a pond in the middle and some lovely muddy puddles that are slow to dry even in summer! Also snakes have been spotted in the long grass in the middle. Note also that the area is poorly fenced in some places and unfenced in others.", "time": 1707209333, "rating": 4, "language": "en", "author_url": "https://www.google.com/maps/contrib/117883670531701127746/reviews", "translated": false, "author_name": "Laura A", "original_language": "en", "profile_photo_url": "https://lh3.googleusercontent.com/a-/ALV-UjWUP6DxFNoS17yYW9MFd3787Z6hxE3m5cqAXmzveDTCfl2atXYQ=s128-c0x00000000-cc-rp-mo-ba5", "relative_time_description": "7 months ago"}], "geometry": {"location": {"lat": -37.8792476, "lng": 145.1979803}, "viewport": {"northeast": {"lat": -37.8779190697085, "lng": 145.1998683302915}, "southwest": {"lat": -37.8806170302915, "lng": 145.1971703697085}}}, "place_id": "ChIJ3yag9Fs-1moRUOAxBXZWBA8", "vicinity": "Nortons Lane, Wantirna South", "plus_code": {"global_code": "4RJ745CX+85", "compound_code": "45CX+85 Wantirna South VIC, Australia"}, "reference": "ChIJ3yag9Fs-1moRUOAxBXZWBA8", "utc_offset": 600, "adr_address": "<span class="street-address">Nortons Ln</span>, <span class="locality">Wantirna South</